import { useState } from "react";

interface Props {
  onClick?: () => void;
}

const Strategie = ({ onClick }: Props) => {
  const [showStrategyList, setStrategyList] = useState(false);
  const [showVulnerability, setshowVulnerability] = useState(false);
  const [showOwaspList, setShowOwaspList] = useState(false);
  const [showCweList, setShowCweList] = useState(false);
  const [showArticleList, setShowArticle] = useState(false);
  const [showFasiList, setFasiList] = useState(false);

  function handleFasiClick() {
    setFasiList(!showFasiList);
    if (onClick) {
      onClick();
    }
  }
  function handleArticleClick() {
    setShowArticle(!showArticleList);
    if (onClick) {
      onClick();
    }
  }
  const handleVulnerabilityClick = () => {
    setshowVulnerability(!showVulnerability);

    if (showOwaspList === true || showCweList === true) {
      setShowCweList(false);
      setShowOwaspList(false);
    }
    if (onClick) {
      onClick();
    }
  };

  function handleStrategyClick() {
    setStrategyList(!showStrategyList);
    if (onClick) {
      onClick();
    }
  }

  const handleOwaspButtonClick = () => {
    setShowOwaspList(!showOwaspList);
    if (showCweList === true) {
      setShowCweList(!showCweList);
    }
    if (onClick) {
      onClick();
    }
  };

  const handleCweButtonClick = () => {
    setShowCweList(!showCweList);
    if (showOwaspList === true) {
      setShowOwaspList(!showOwaspList);
    }
    if (onClick) {
      onClick();
    }
  };

  const articles = [
    "Articolo 5",
    "Articolo 6",
    "Articolo 7",
    "Articolo 12",
    "Articolo 13",
    "Articolo 25",
    "Articolo 28",
    "Articolo 32",
    "Articolo 33",
    "Articolo 34",
    "Articolo 35",
  ];
  const OWASP = [
    "A01",
    "A02",
    "A03",
    "A04",
    "A05",
    "A06",
    "A07",
    "A08",
    "A09",
    "A10",
  ];

  const vulnerabilities = [
    "CWE-20",
    "CWE-22",
    "CWE-77",
    "CWE-78",
    "CWE-79",
    "CWE-89",
    "CWE-94",
    "CWE-269",
    "CWE-276",
    "CWE-287",
    "CWE-306",
    "CWE-434",
    "CWE-502",
    "CWE-798",
    "CWE-862",
    "CWE-863",
    "CWE-918",
  ];

  const strats = [
    "Minimizzazione",
    "Occultamento",
    "Aggregazione",
    "Separazione",
    "Dimostrazione",
    "Informazione",
    "Rafforzamento",
    "Controllo",
  ];

  const mcv = ["Model", "Control", "View"];

  const fasi = ["6.0", "7.2", "7.4", "7.5"];

  return (
    <div>
      <button onClick={handleStrategyClick}>Strategie</button>
      {showStrategyList && (
        <ul>
          {strats.map((strat, index) => (
            <li key={index}>{strat}</li>
          ))}
        </ul>
      )}
      <button onClick={handleVulnerabilityClick}>Vulnerabilità</button>
      {showVulnerability && (
        <>
          <button onClick={handleOwaspButtonClick}>OWASP</button>
          {showOwaspList && (
            <ul>
              {OWASP.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          )}
          <button onClick={handleCweButtonClick}>CWE</button>
          {showCweList && (
            <ul>
              {vulnerabilities.map((vulnerability, index) => (
                <li key={index}>{vulnerability}</li>
              ))}
            </ul>
          )}
        </>
      )}
      <button onClick={handleArticleClick}>Articoli</button>
      {showArticleList && (
        <ul>
          {articles.map((article, index) => (
            <li key={index}>{article}</li>
          ))}
        </ul>
      )}
      <button onClick={handleFasiClick}>Fasi</button>
      {showFasiList && (
        <ul>
          {fasi.map((fase, index) => (
            <li key={index}>{fase}</li>
          ))}
        </ul>
      )}
            <button
        className="w-full py-2 px-4 bg-green-600 text-black rounded-full hover:bg-green-700"
        onClick={handleMCVClick}
      >
        MCV
      </button>
      {showMCVList && (
        <ul>
          {mcv.map((fase, index) => (
            <li key={index}>{fase}</li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Strategie;
